/**
 * 
 * @param {*} nums 
 * @param {*} target 
 * 
 * 思路二：双指针碰撞
 * 一开始指首尾
 * 比目标大 后面的往前移
 * 比目标小 前面的往后移
 */
var twoSum = function(nums, target) {
  let start = 0;
  let end = nums.length - 1;
  while(start < end){
    if(target - nums[start] === nums[end]){
      return [nums[start], nums[end]];
    }
    if(target - nums[start] < nums[end]){
      end--;
    }
    if(target - nums[start] > nums[end]){
      start++;
    }
  }
}

